column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli ಯು ನೇರವಾದ JSON ಸಂರಚನಾ ದತ್ತಾಂಶ ಮತ್ತು ಸಂರಚನೆಯನ್ನು ಹೊಂದಿರುವ ಕಡತದ ಹೆಸರು ಎರಡನ್ನೂ ಸಹ ಅಂಗೀಕರಿಸುತ್ತದೆ. ಎರಡನೆಯ ಸಂದರ್ಭದಲ್ಲಿ, ಕಡತವನ್ನು ಓದಿ ನಂತರ ಅದರಲ್ಲಿರುವುದನ್ನು ಈ ಗುಣಕ್ಕೆ ಸೇರಿಸಲಾಗುತ್ತದೆ.

ಉದಾಹರಣೆಗೆ: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
ಬಳಕೆ: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
ಬಳಕೆ: nmcli general status { help }

NetworkManager ನ ಒಟ್ಟಾರೆ ಸ್ಥಿತಿಯನ್ನು ತೋರಿಸುತ್ತದೆ.
'status' ಎನ್ನುವುದು ಪೂರ್ವನಿಯೋಜಿತ ಕ್ರಿಯೆಯಾಗಿರುತ್ತದೆ, ಇದರರ್ಥ 'nmcli gen' ಎನ್ನುವುದು 'nmcli gen status' ಯನ್ನು ಚಲಾಯಿಸುತ್ತದೆ ಎಂದು

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
ಬಳಕೆ: nmcli networking { COMMAND | help }

  COMMAND := { on | off | connectivity }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
ಬಳಕೆ: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

ಎಲ್ಲಾ ರೇಡಿಯೊ ಸ್ವಿಚ್‌ಗಳ ಸ್ಥಿತಿಯನ್ನು ಪಡೆದುಕೊ, ಅಥವ ಅವುಗಳನ್ನು ಸಕ್ರಿಯ/ನಿಷ್ಕ್ರಿಯಗೊಳಿಸು.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
ಬಳಕೆ: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

ಎಲ್ಲಾ ವೈ-ಫೈ ರೇಡಿಯೊ ಸ್ವಿಚ್‌ಗಳ ಸ್ಥಿತಿಯನ್ನು ಪಡೆದುಕೊ, ಅಥವ ಅವುಗಳನ್ನು ಸಕ್ರಿಯ/ನಿಷ್ಕ್ರಿಯಗೊಳಿಸು.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
ಬಳಕೆ: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

ಎಲ್ಲಾ ಮೊಬೈಲ್‌ ಬ್ರಾಡ್‌ಬ್ಯಾಂಡ್‌ ರೇಡಿಯೊ ಸ್ವಿಚ್‌ಗಳ ಸ್ಥಿತಿಯನ್ನು ಪಡೆದುಕೊ, ಅಥವ ಅವುಗಳನ್ನು ಸಕ್ರಿಯ/ನಿಷ್ಕ್ರಿಯಗೊಳಿಸು.
